import React , { Component } from 'react';


// =================
// COMPONENT
// =================
class EntryForm extends Component {
    constructor(props) {
        super(props)
        this.state = {
            date: '',
            title: '',
            text: '',
            image: '',
            author: '',
            status: 'new'
        }
    }
    render() {
        return (
            <form>
                <fieldset>
                    <legend>Create New Entry</legend>
                </fieldset>
            </form>
        );
    }
}

// ================
// EXPORT
// ================
export default EntryForm;
